import React from 'react';
import './styles.css';

import { Menu, Dropdown, Button } from 'antd';

const menu = (
    <Menu>
        <Menu.Item>
            <a target="_blank" rel="noopener noreferrer" href="http://www.alipay.com/">
                1st menu item
        </a>
        </Menu.Item>
        <Menu.Item>
            <a target="_blank" rel="noopener noreferrer" href="http://www.taobao.com/">
                2nd menu item
        </a>
        </Menu.Item>
        <Menu.Item>
            <a target="_blank" rel="noopener noreferrer" href="http://www.tmall.com/">
                3rd menu item
        </a>
        </Menu.Item>
    </Menu>
);

export default class Header extends React.Component {
    render() {
        return (
            <div className="container">
                <div className="header" />
                <div className="navbar">
                    <div className="main-navbar">
                        <Button type="primary">TRANG CHỦ</Button>
                        <Button style={{ backgroundColor: '#336699', border: 'none', height: '40px', color:'#fff' }} >GIỚI THIỆU</Button>
                        <Dropdown overlay={menu} placement="bottomLeft">
                            <Button style={{ backgroundColor: '#336699', border: 'none', height: '40px',color:'#fff' }} >KẾT QUẢ</Button>
                        </Dropdown>
                    </div>
                </div>
            </div>
        )
    }
}
